const api = "http://localhost:0727/messages/recent";

//Will become Get Users or I will turn this into a dynamic running 
// function for all queries 
const Recent= async()=>{
   
  try { 
		console.log("Getting recent")
		fetch(api, {
			method: "GET",
			headers: {
				"Content-Type": "application/json",
			}
		})
			.then((response) => {
				console.log(response)
				return response.json();
			})
			.then((data) => {
				if(data.Success){
					console.log("Recent:", data)
					sessionStorage.setItem('user', JSON.stringify(data.Sesh))
				}else if(data.Fail){
					console.log("failed recent:", data.Fail)
				}
				
		
			})
			.catch((error) => {
				console.log("Error during fetch operation:", error );
			});
	
    return ;
 } catch(Err){
    console.log(Err);
 }
}

module.exports= {
    Recent
}
